import React from "react";

export default function parcelItem({ data }) {
  const itemsArray = data.map((item) => <li key={item.id}>{item.title}</li>);
  return (
    <div className="display">
      <h1>Page</h1>
      {data.length > 0 ? <u>{itemsArray}</u> : <p>No pending task</p>}
    </div>
  );
}
